import "./App.css";
import { Routes, Route } from "react-router-dom";
import Home from "./pages/home";
import WearthList from "./pages/weatherList";

function App() {
  return (
    <Routes>
      <Route index element={<Home />} />
      <Route path="WearthList" element={<WearthList />} />
    </Routes>
  );
}

export default App;
